  in LAS format. Classified LAS data was also used as a base for collection of hydro
  features, delivered in MicroStation v8 format. The dates of collection are: 1. JASPER
  COUNTY (full county): 20061227 to 20070216 2. COLLETON COUNTY (full county: 20070216
  to 20070323 3. CHARLESTON COUNTY (Partial County): 20070222 to 20070223\",\n\t\"owner_org\":
